import React from 'react';
import { Link, Element } from 'react-scroll';
import Home from './componentes/Home';
import Nosotros from './componentes/Nosotros';
import Obras from './componentes/Obras';
import Clientes from './componentes/Clientes';
import Contacto from './componentes/Contacto';
import logo from './componentes/img/logo.png';
import './App.css';



function App() {
  return (
    <div className="App">
      <header className="header">

        <img src={logo} alt="Logo de RPM PROYECTOS" />
        <nav>
          <Link to="home" smooth={true} duration={500}>Inicio</Link>
          <Link to="nosotros" smooth={true} duration={500}>Nosotros</Link>
          <Link to="obras" smooth={true} duration={500}>Obras</Link>
          <Link to="clientes" smooth={true} duration={500}>Clientes</Link>
          <Link to="contacto" smooth={true} duration={500}>Contacto</Link>
        </nav>
      </header>

      <Element name="home">
        <Home />
      </Element>
      <Element name="nosotros">
        <Nosotros />
      </Element>
      <Element name="obras">
        <Obras />
      </Element>
      <Element name="clientes">
        <Clientes />
      </Element>
      <Element name="contacto">
        <Contacto />
      </Element>
    </div>
  );
}

export default App;
